require(['spinbox', 'lib/three.min', 'lib/jquery.min'], function (Spinbox) {
	//instantiate variables
	var
	renderer,
	scene,
	camera,
	projector,
	ambientLight,
	directionalLight,
	fov = 45;
	
	//instantiate container for all boxes
	var spinboxes = new Array();

	/*
	document listener
	 */
	$(document).ready(function () {
		initialize();
	});

	/*
	Click listener
	 */
	$(document).on("click", function (event) {
		fireNewBox(event);
	});

	/*
	Render and animation loop
	 */
	function initialize() {
	
		// Create a new WebGlRenderer
		renderer = new THREE.WebGLRenderer({
				antialias : true
			});
		renderer.setSize($(document).width(), $(document).height());
		
		// Append it to the document using our friend jQuery
		$('body').append(renderer.domElement);

		// Create a projector for projection purposes
		projector = new THREE.Projector();
		
		// Creata a camera and set its position
		camera = new THREE.PerspectiveCamera(
				fov,
				window.innerWidth / window.innerHeight,
				1,
				10000);
		camera.position.z = 5;
		camera.position.y = 0;

		// Create a new scene
		scene = new THREE.Scene();

		// Add an ambient light
		ambientLight = new THREE.AmbientLight(0x333333);
		scene.add(ambientLight);

		// Add a directional light
		directionalLight = new THREE.DirectionalLight(0xeeeeee);
		directionalLight.position.set(1, 1, 1).normalize();
		scene.add(directionalLight);
		
		// Start drawing
		render();
	}
	
	/*
	Render method
	Takes care of animation calls
	 */
	function render() {
		
		//for all objects in box array
		for (var i = 0; i < spinboxes.length; i++) {
			
			//check if box has loaded
			if (spinboxes[i].hasLoaded()) {
			
				//if box isn't present, add it
				if (!spinboxes[i].onScene()) {
					spinboxes[i].addToScene(scene);
				}
				
				//else, update
				else {
					spinboxes[i].updateBox();
				}
			}
		}
		
		//draw and move on to next frame
		renderer.render(scene, camera);
		requestAnimationFrame(render);
	}
	
	/*
	Create a new box
	 */
	function fireNewBox(event) {
	
		//create vector at mouse event
		var vector = new THREE.Vector3(
				(event.clientX / window.innerWidth) * 2 - 1,
				-1 * (event.clientY / window.innerHeight) * 2 + 1,
				.5);
				
		//unproject
		projector.unprojectVector(vector, camera);
		
		//subtract camrea position from vector to get dir
		var dir = vector.sub(camera.position).normalize();
		
		//cast ray from position in dir
		var ray = new THREE.Raycaster(camera.position, dir);
		
		//get distance
		var distance =  - camera.position.z / dir.z;
		
		//get desired position by cloning camera and adding distance
		var pos = camera.position.clone().add(
				dir.multiplyScalar(distance));
		
		//get index of new spinbox object
		var i = spinboxes.push(new Spinbox());
		
		//load new spinbox
		spinboxes[i - 1].load(pos);
	}

	/*
	Creates a texture for the glow
	 */
	function generateGlowTexture() {
	
		//create a new canvas to receive the texture
		var canvas = document.createElement('canvas');
		canvas.width = 600;
		canvas.height = 600;
		
		//get the 2d context for drawrin'
		var context = canvas.getContext('2d');

		//draw a gradient
		var radgrad = context.createRadialGradient(300.000, 300.000, 0.000, 300.000, 300.000, 300.000);

		// Add colors
		radgrad.addColorStop(0.000, 'rgba(100, 100, 100, 0.7)');
		radgrad.addColorStop(1.000, 'rgba(255, 255, 255, 0.9)');

		// Fill with gradient
		context.fillStyle = radgrad;
		context.fillRect(0, 0, 600, 600);
		
		//return the canvas object
		return canvas;
	}

	/*
	Creates a diaper canvas... because.
	Returns an HTML5 canvas
	 */
	function makeDiaper() {

		// create a DOM canvas for diaping and set dimensions
		var canvas = document.createElement('canvas');
		canvas.width = 256;
		canvas.height = 256;

		// get canvas 2d context for manipulation
		var context = canvas.getContext('2d');

		// create an image inside the context
		var diaper = new Image();

		// when ready, draw the diaper into the context
		diaper.onload = function () {
			context.drawImage(diaper, 0, 0);
		};

		// diaper uri definition
		diaper.src = 'data:image/jpeg;base64,';

		// return the canvas
		return canvas;
	}
});
